import React from "react";
import {
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Checkbox,
  ListItemText,
  withStyles
} from "@material-ui/core";

const styles = theme => ({
  formControl: {
    margin: theme.spacing.unit,
    width: 200
  }
});

export default withStyles(styles)(
  ({ classes, values, handleChange, selection, data }) => {
    return (
      <FormControl className={classes.formControl}>
        <InputLabel htmlFor="select-multiple-checkbox">{data}</InputLabel>
        <Select
          multiple
          value={selection}
          onChange={handleChange("discTypeSelector")}
          inputProps={{
            name: data,
            id: `${data}-native-simple`
          }}
        >
          {values.map(value => (
            <MenuItem key={values.indexOf(value)}>
              <Checkbox checked={values.indexOf(value) > -1} />
              <ListItemText name={value} />
            </MenuItem>
          ))}
        </Select>
      </FormControl>
    );
  }
);
